import React,{ useState } from 'react';
import '../App.css';

function Projects() {
    const [techno, setTechno] = useState("React");

    projects = () => {
    <div>LA techno est :{techno}</div>
    }
    return (<div>

                <ul class="pagination center">
                    <li onClick={() => setTechno("React")} className={`${(techno === "React") ? 'active teal' : 'waves-effect'}`}>&nbsp;&nbsp;&nbsp;React&nbsp;&nbsp;&nbsp;</li>
                    <li onClick={() => setTechno("Angular")} className={`${(techno === "Angular") ? 'active teal' : 'waves-effect'}`}>&nbsp;&nbsp;&nbsp;Angular&nbsp;&nbsp;&nbsp;</li>
                    <li onClick={() => setTechno("JAVA")} className={`${(techno === "JAVA") ? 'active teal' : 'waves-effect'}`}>&nbsp;&nbsp;&nbsp;JAVA&nbsp;&nbsp;&nbsp;</li>
                    <li onClick={() => setTechno("Python")} className={`${(techno === "Python") ? 'active teal' : 'waves-effect'}`}>&nbsp;&nbsp;&nbsp;Python&nbsp;&nbsp;&nbsp;</li>
                    <li onClick={() => setTechno("C")} className={`${(techno === "C") ? 'active teal' : 'waves-effect'}`}>&nbsp;&nbsp;&nbsp;C&nbsp;&nbsp;&nbsp;</li>
                </ul>

                {projects()}

            </div> );
}

export default Projects;
